import App, { AppProps } from 'next/app'
import * as React from "react";

interface BaseProps extends AppProps {}

class Base extends App<BaseProps> {
    static async getInitialProps({ Component, pageProps }: BaseProps) {
        return { pageProps }
    }
}



export default Base
